#define IPHONE 1
#import <UIKit/UIKit.h>
#import "AppDelegate.h"
#include "agb.h"
#include "agbi.h"

int main(int argc, char *argv[])
{
    unsigned char* buffer =
    agb_base64_read ( "",0 ) ;
	if ( buffer ) {
        agb_vm_t* vm = agb_vm_new ( buffer ) ;
		agb_memory_free ( buffer ) ;
        if ( ! vm ) {
			return EXIT_FAILURE ;
		}
		agb_thread_t* thread = agb_thread_new ( vm ) ;
		if ( ! thread ) {
			return EXIT_FAILURE ;
		}
		agb_method_t* method = agb_method_classname ( vm , "Test" , "main()" , 1 ) ;
		if ( ! method ) {
			return EXIT_FAILURE ;
		}
		int flag = agb_vm_execute ( thread , agb_method_pc ( method ) ) ;
		if ( flag != EXIT_SUCCESS ) {
			return flag ;
		}
		agb_vm_free ( vm ) ;
	}
    @autoreleasepool {
        return UIApplicationMain(argc, argv, nil, NSStringFromClass([AppDelegate class]));
    }
}
